import React from 'react';


const Form = () => {
    return(
        <form onSubmit={this.handleSubmit}>
            <label>
                Add Budget:
                <input type="text" value={this.state.value} 
                onChange={this.handleChange} />
            </label>
            <label>
                Add Expenses:
                <input type="text" value={this.state.value}
                onChange={this.handleChange} />
            </label>
            <input type="submit" value="Submit" />
        </form>
    );
}

export default Form;
